INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_introText`, `field_ctaButtonText`, `field_heroText`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, '2017-06-21 04:39:24', '2017-06-21 04:39:24', '057999a6-6ebd-417e-9a66-e459c71dee3d'),
 ('2', '2', 'en_us', 'Homepage', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Motivations.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, '<small>We provide the</small> <span class=\"highlight\">structure and support</span> <small>you need for your journey towards</small> <span class=\"highlight\">long term sobriety.</span>', '2017-06-21 04:39:27', '2017-06-22 08:28:59', 'aa81728b-d4f6-4859-ab3e-16e8b93a81b4'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Motivations.dev. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, '2017-06-21 04:39:27', '2017-06-21 04:39:27', 'eadb0fcf-b0ea-4d7f-87dc-0ac414bd7e4f'),
 ('4', '4', 'en_us', 'Breakthrough Stigma', NULL, '<p>Ex keffiyeh readymade, culpa excepteur you probably haven\'t heard of them proident +1 anim synth. Squid laboris tattooed woke helvetica chicharrones kale chips tote bag gastropub. Succulents live-edge cupidatat ipsum ut pariatur. Deep v green juice PBR&amp;B scenester, humblebrag plaid cornhole disrupt.</p>', 'Learn More', NULL, '2017-06-22 03:05:27', '2017-06-23 04:01:55', 'd1d42e27-26a7-426a-93e6-9231ee03b20e'),
 ('9', '9', 'en_us', 'Breakthrough', NULL, NULL, NULL, NULL, '2017-06-22 05:12:14', '2017-06-23 05:27:48', 'c7c50d4f-50fe-48c8-acae-d24b51ee898a'),
 ('11', '11', 'en_us', 'Breakthrough', NULL, NULL, NULL, NULL, '2017-06-22 05:16:19', '2017-06-23 05:27:48', '7c1612a2-8f01-44b8-8caa-f374d75c0a79'),
 ('12', '12', 'en_us', 'Structure + Support', NULL, '<p>Pellentesque viverra, diam ac eleifend varius, urna turpis blandit dolor, vitae maximus eros ex eget lacus. Nulla vitae fringilla risus, tempor euismod purus. Nam eget auctor massa. Nulla id volutpat metus, vitae feugiat diam. Maecenas quis felis vitae massa eleifend tincidunt.</p>', 'Learn More', NULL, '2017-06-22 05:38:58', '2017-06-23 04:04:16', '04563601-6dda-47a1-b655-b52cfab890d4'),
 ('13', '13', 'en_us', 'Structure', NULL, NULL, NULL, NULL, '2017-06-22 06:09:27', '2017-06-23 05:27:48', '8db82e0e-8158-44ed-a900-661187d73007'),
